	add("psychologese", "{\"term\":\"psychologese\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|psychology|ese|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The specialised language (or jargon) of psychology\", \"priority\":1}]}, \"synonyms\":{}}");

	add("psychologist", "{\"term\":\"psychologist\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|psychology|ist|alt1\u003dpsycholog(y)|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An expert in the field of psychology\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"Investigating why IBM salespeople were so successful, researchers found that IBM set \u0027easy\u0027 targets for their salespeople rather than targets that were difficult to reach and so most of their salespeople achieved their targets. IBM had hired \u0027\u0027psychologists\u0027\u0027 to define optimum motivational goals for their salespeople and it was discovered that if the targets were achievable the salespeople became very confident and motivated (unlike their demotivated cousins in rival companies) and went out and sold even more computers\", \"priority\":2}]}, \"synonyms\":{}}");

	add("psychology", "{\"term\":\"psychology\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"French\", \"ancient greek (to 1453)\", \"Latin\"], \"text\":\"From French \u0027psychologie\u0027 from Latin \u0027psychologia\u0027 (coined by w:Marko Marulić|Marko Marulić from Ancient greek (to 1453) \u0027sc\u003dpolytonic|ψυχή|lang\u003dgrc\u0027 () + \u0027-logia\u0027 () .\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The study of the human mind\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The study of human behavior\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The study of animal behavior\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"The mental, emotional, and behavioral characteristics pertaining to a specified person, group, or activity\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1970\u0027\u0027, Mary M. Luke, \u0027A Crown for Elizabeth\u0027, page 8\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"For generations, historians have conjectured everything from a warped \u0027\u0027psychology\u0027\u0027 to a deformed body as accounting for Elizabeth\u0027s preferred spinsterhood\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1969\u0027\u0027, Victor Alba, \u0027The Latin Americans\u0027, page 42\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"In the United States, the \u0027\u0027psychology\u0027\u0027 of a laborer, a farmer, a businessman does not differ in any important respect\", \"priority\":8}]}, \"synonyms\":{}}");

	add("psychomedicine", "{\"term\":\"psychomedicine\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|psycho|medicine|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A branch of primitive medicine that attempts to explain biological causes and effects by means of basic psychology\", \"priority\":1}]}, \"synonyms\":{}}");

	add("psychometrics", "{\"term\":\"psychometrics\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|psycho|metrics|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The design of psychological tests to measure intelligence, aptitude and personality; and the analysis and interpretation of their results\", \"priority\":1}]}, \"synonyms\":{}}");

	add("psychometry", "{\"term\":\"psychometry\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|psycho|metry|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The paranormal ability to discover information about an object\u0027s past, and especially about its past owners, merely by handling it\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The use of psychological tests to measure intelligence, abilities, attitudes, and personality traits\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"1960\u0027\u0027, \u0027Indian Journal of Psychology\u0027 XXXV–XXXVII, [http://books.google.co.uk/books?ei\u003djgm3Ut2YC8qR0AXhpICADg\u0026amp;id\u003djJItAAAAMAAJ\u0026amp;dq\u003d%22psychometry%22\u0026amp;focus\u003dsearchwithinvolume\u0026amp;q\u003d%22psychometry+and+paedometry%22 page 25\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"In \u0027\u0027psychometry\u0027\u0027 and paedometry his original contributions will be little unless he had equipped himself well with the subjects like mathematics and statistics\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"ibidem\u0027, [http://books.google.co.uk/books?ei\u003djgm3Ut2YC8qR0AXhpICADg\u0026amp;id\u003djJItAAAAMAAJ\u0026amp;dq\u003d%22psychometry%22\u0026amp;focus\u003dsearchwithinvolume\u0026amp;q\u003d%22psychometry+and+physiological+psychology%22 page 27\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"Again, barring in a few universities \u0027\u0027psychometry\u0027\u0027 and physiological psychology are not regarded as compulsory papers\", \"priority\":6}]}, \"synonyms\":{}}");

	add("psychomime", "{\"term\":\"psychomime\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|psycho|mime|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A word or phrase that depicts a certain psychological state or bodily feeling\", \"priority\":1}]}, \"synonyms\":{}}");

	add("psychonaut", "{\"term\":\"psychonaut\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|psycho|naut|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A person who explores his or her own psyche, commonly with the aid of psychedelic drugs\", \"priority\":1}]}, \"synonyms\":{}}");

	add("psychopathy", "{\"term\":\"psychopathy\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"From {{confix|psycho|pathy|lang\u003den}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A personality disorder indicated by a pattern of lying, exploitation, heedlessness, arrogance, sexual promiscuity, low self-control, and lack of empathy and remorse. Violent and criminal offenses may be indicative of this disorder\", \"priority\":1}]}, \"synonyms\":{}}");

