	add("psychopomp", "{\"term\":\"psychopomp\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From Ancient greek (to 1453) \u0027ψυχοπομπός\u0027 () from \u0027ψυχο-\u0027 (psycho-) + \u0027πομπός\u0027 (conductor)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A spirit, deity, person, etc., who guides the souls of the dead to the afterlife\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1994\u0027\u0027, Brian B. Schmidt, \u0027Israel\u0027s Beneficent Dead: Ancestor Cult and Necromancy in Ancient Israelite Religion and Tradition\u0027, [https://books.google.com.au/books?id\u003dg8utc51u4noC\u0026amp;pg\u003dPA84\u0026amp;dq\u003d%22psychopomp%22%7C%22psychopomps%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;redir_esc\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22psychopomp%22%7C%22psychopomps%22\u0026amp;f\u003dfalse page 84\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"It is generally assumed that the sun goddess functions in the Shapash hymn as \u0027\u0027\u0027psychopomp\u0027\u0027\u0027, transporter of the dead to and from their netherly abode\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1996\u0027\u0027, Juliette Wood, \u0027Chapter One: The Concept of the Goddess\u0027, Sandra Billington, Miranda Green (editors), \u0027The Concept of the Goddess\u0027, [https://books.google.com.au/books?id\u003doBiEAgAAQBAJ\u0026amp;pg\u003dPA8\u0026amp;dq\u003d%22psychopomp%22%7C%22psychopomps%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;redir_esc\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22psychopomp%22%7C%22psychopomps%22\u0026amp;f\u003dfalse page 8\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"These intermediaries take various forms: the \u0027\u0027psychopomps\u0027\u0027 of the Neo platonists, the angelic beings of ritual magic, the spirit guides of theosophy, the aliens of modern Ufologists, and the neopagan gods which are a feature of late twentieth-century alternative thought\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"2000\u0027\u0027, \u0027\u0027, Fourth Estate 2011, p. 3\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"For most of us, Dr Wilder Penrose was our amiable , the \u0027\u0027psychopomp\u0027\u0027 who steered our darkest dreams towards the daylight\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"2001\u0027\u0027, James R. Lewis, \u0027Odd Gods: New Religions \u0026amp; the Cult Controversy\u0027, [https://books.google.com.au/books?id\u003d6Y7XAAAAMAAJ\u0026amp;q\u003d%22psychopomp%22+%22spiritualism%22\u0026amp;dq\u003d%22psychopomp%22+%22spiritualism%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;redir_esc\u003dy page 323\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"Characteristically, the shaman is a healer, a \u0027\u0027psychopomp\u0027\u0027 (someone who guides the souls of the dead to their home in the afterlife), and more generally a mediator between her or his community and the world of spirits (most often animal spirits and the spirits of the forces of nature\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"2012\u0027\u0027, Dennis L. Merritt, \u0027Hermes, Ecopsychology, and Complexity Theory\u0027, Volume 3, [https://books.google.com.au/books?id\u003dju-NsCN3w1oC\u0026amp;pg\u003dPA43\u0026amp;dq\u003d%22psychopomp%22%7C%22psychopomps%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;redir_esc\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22psychopomp%22%7C%22psychopomps%22\u0026amp;f\u003dfalse page 43\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"This is an allusion to Hermes as the guide of souls, the \u0027\u0027psychopomp\u0027\u0027; an important element of Hermes\u0027 nature that receives only this scant mention in the Hymn. To understand Hermes as \u0027\u0027psychopomp\u0027\u0027 we must get to the root of the Hermes of life and death\", \"priority\":14}]}, \"synonyms\":{}}");

	add("psychosis", "{\"term\":\"psychosis\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"ancient greek (to 1453)\"], \"text\":\"From {{confix|psych|osis|lang\u003den}} or from Ancient greek (to 1453) \u0027ψύχωσις\u0027 (animation, principle of life)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A severe mental disorder, sometimes with physical damage to the brain, marked by a deranged personality and a distorted view of reality\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"title\u003d[http://www.economist.com/news/science-and-technology/21601233-exploring-link-between-manganese-and-parkinsons-disease-subtle-effects Subtle passage\u003dManganism has been known about since the 19th century, when miners exposed to ores containing manganesebegan to totter, slur their speech and behave like someone inebriated. The poisoning was irreversible, and soon ended in \u0027\u0027psychosis\u0027\u0027 and death\", \"priority\":2}]}, \"synonyms\":{}}");

	add("psychosynthesis", "{\"term\":\"psychosynthesis\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|psycho|synthesis|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A form of psychology based on the direct experience of the self\", \"priority\":1}]}, \"synonyms\":{}}");

	add("psychrometer", "{\"term\":\"psychrometer\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|psychro|meter|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of several instruments used to measure the relative humidity of the atmosphere; especially a wet-and-dry-bulb hygrometer\", \"priority\":1}]}, \"synonyms\":{}}");

	add("psychrometry", "{\"term\":\"psychrometry\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|psychro|metry|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"the measurement or study of the thermodynamic properties of moist air\", \"priority\":1}]}, \"synonyms\":{}}");

	add("psychrophile", "{\"term\":\"psychrophile\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|psychro|phile|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"An organism that can live and thrive at temperatures much lower than normal; a form of extremophile\", \"priority\":1}]}, \"synonyms\":{}}");

	add("psychrophyte", "{\"term\":\"psychrophyte\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{confix|psychro|phyte|t1\u003dcold|t2\u003dplant|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any plant that tolerates, or thrives in a cold climate, especially in arctic or alpine conditions\", \"priority\":1}]}, \"synonyms\":{}}");

	add("psychroplanet", "{\"term\":\"psychroplanet\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{prefix|psychro|planet|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"A habitable planet, such as Mars, that has a surface temperature of −50 to 0°C, colder than is optimal for most terrestrial life\", \"priority\":1}]}, \"synonyms\":{}}");

	add("psychspeak", "{\"term\":\"psychspeak\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{suffix|psych|speak|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The jargon used by psychologists or psychiatrists\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1992\u0027\u0027, Rob Buckman, Yvonne Kason, \u0027How to break bad news: a guide for health care professionals\u0027 (page 83\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The languages of all health care professions - medspeak, nursespeak, \u0027\u0027psychspeak\u0027\u0027, and so on - are extremely useful, but they are only intelligible to the initiated\", \"priority\":3}]}, \"synonyms\":{}}");

	add("psyllium", "{\"term\":\"psyllium\", \"etymology\":{\"influencers\":[], \"languages\":[], \"text\":\"{{rfe|lang\u003den}}\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Any of several plants of the genus \u0027Plantago\u0027, whose seeds are used commercially for the production of mucilage\", \"priority\":1}]}, \"synonyms\":{}}");

